import React, { useState } from "react";
import { Layout, Menu } from 'antd';
import {
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
  FormOutlined,
  OrderedListOutlined
} from '@ant-design/icons';
import 'antd/dist/antd.css';
import '../../global.css';

const { Sider } = Layout;
const { SubMenu } = Menu;

function MenuSite(props){
	return(
		    <Sider className="menu" trigger={null} collapsible collapsed={props.open}>
          <div className="logo" />
          <Menu className="menu" mode="inline" defaultSelectedKeys={['1']}>
            <Menu.Item key="1" icon={<UserOutlined />}>
              nav 1
            </Menu.Item>
            <Menu.Item key="2" icon={<VideoCameraOutlined />}>
              nav 2
            </Menu.Item>
            <Menu.Item key="3" icon={<UploadOutlined />}>
              nav 3
            </Menu.Item>

            <SubMenu key="sub1" icon={<FormOutlined />} title="Cadastros">
              <Menu.Item key="sub1-1" className="menu">Produto</Menu.Item>
              <Menu.Item key="sub1-2" className="menu">Categoria</Menu.Item>
              <Menu.Item key="sub1-3" className="menu">Tamanho</Menu.Item>
              <Menu.Item key="sub1-4" className="menu">Borda</Menu.Item>
            </SubMenu>

            <SubMenu key="sub2" icon={<OrderedListOutlined />} title="Listagens">
              <Menu.Item key="sub2-1">Produtos</Menu.Item>
              <Menu.Item key="sub2-2">Categorias</Menu.Item>
              <Menu.Item key="sub2-3">Tamanhos</Menu.Item>
              <Menu.Item key="sub2-4">Bordas</Menu.Item>
            </SubMenu>


          </Menu>
        </Sider>
	);
}

export default MenuSite;
